import './App.css';
import React from 'react';
import { BrowserRouter, Route, Link, Routes } from 'react-router-dom';
import Home from '../src/pages/home/home';
import LogIn from '../src/pages/login/login';
import Mine from '../src/pages/mine/mine';
import { useState } from 'react';
import { Navigate } from 'react-router-dom';

function App() {
    const tipsData = [
        {id: 1, image: require('./components/tips/tippic/onlineserve.png').default, tip: 'Tip 1'},
        {id: 2, image: require('./components/tips/tippic/feedback.png').default, tip: 'Tip 2'},
        {id: 3, image: require('./components/tips/tippic/prointro.png').default, tip: 'Tip 3'},
        {id: 4, image: require('./components/tips/tippic/versionlog.png').default, tip: 'Tip 4'},
        {id: 5, image: require('./components/tips/tippic/team.png').default, tip: 'Tip 5'},
        {id: 6, image: require('./components/tips/tippic/setting.png').default, tip: 'Tip 6'},
    ];
    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const handleLogin = () => {
        //setIsLoggedIn(true);
        if(isLoggedIn){
            navigate("./home")
        }
    }

    return (
        <BrowserRouter>
            <Link to="/home">home</Link>
            <Link to="/load">load</Link>
            <Link to="/mine">mine</Link>
            <Routes>
                <Route path="home" element={isLoggedIn ? <Home/> : <Navigate to="/load" />} ></Route>
                <Route path="load" element={<LogIn onLogin={handleLogin}/>} ></Route>
                <Route path="mine" element={<Mine tipsData={tipsData}/>} ></Route>
            </Routes>
        </BrowserRouter>
    );
}
export default App;
